    const dispatch = useDispatch()
    const pizzastate = useSelector(state => state.getAllFoodReduer)
    useEffect(() => {
        dispatch(getAllFood())
    }, [])
    return (
        <div>
            <div className="row">
                {pizzas.map(pizzas => {
                    return <div className="col-md-4 p-3">
                        <div>
                            <Pizza pizza={pizzas} />
                        </div>
                    </div>
                })}
            </div>
        </div>
    )
}

export default Homescreen
